import React from 'react';
import Card from './card';
import 'bootstrap/dist/css/bootstrap.min.css'

const CardList=({robots})=>{
    return(
    <div className="row">
        <Card id={ robots[1].id } username={ robots[1].username } name={ robots[1].name } email={ robots[1].email }  />
        <Card id={ robots[2].id } username={ robots[2].username } name={ robots[2].name } email={ robots[2].email }  />
        <Card id={ robots[3].id } username={ robots[3].username } name={ robots[3].name } email={ robots[3].email }  />
    </div>
    )
}

export default CardList;
